import React, { useState, useEffect } from "react";
import * as starWarsAPI from "../../util/API/starWarsAPI";
import { Typography, TextField, Button, Grid, Paper } from "@material-ui/core";

export default function Start(props) {

  async function existeGerente() {
    const response = await starWarsAPI.getAllFilms
    console.log("Response: ", response);
  }

  return (
    <div>     <Button
      style={{ marginBottom: 16 }}
      variant="contained"
      color="primary"
      fullWidth
      onClick={existeGerente}
    >
      Entrar
    </Button> </div>
  );
}
